import { useState } from "react";
import Error from "./commponents/Error";
import Form from "./commponents/Form";
import Weather from "./commponents/Weather";


function App() {
  const [weather, setWeather] = useState({})
  const [city, setCity] = useState('');


  return (
    <div className="App">

      <Form setWeather={setWeather} city={city} setCity={setCity} setError={setError} />
      <Weather weather={weather}/>

     { error ?
       <Error city={city} setCity={setCity} error={error} setError={setError}/>
    : weather
     }

    </div>
  );
}

export default App;
